import React, { Component } from 'react';
import Dropdown from 'react-bootstrap/Dropdown';

class DropItems extends Component {
    render() {
        return (
            <DropdownItem href={this.props.href}>{this.props.Item}</DropdownItem>
        )
    }
};

export default DropItems;
